import React, { Component } from 'react';

class SearchAndFilter extends Component {
    constructor(props) {
        super(props);
        this.state = {
            searchQuery: '',
            filterGender: '',
        };
    }

    handleSearchChange = (e) => {
        this.setState({ searchQuery: e.target.value });
    };

    handleFilterChange = (e) => {
        this.setState({ filterGender: e.target.value });
    };

    filterUsers = (user) => {
        const { filterGender } = this.state;

        // Фильтрация по полу
        if (filterGender && user.gender.gender !== filterGender) {
            return false;
        }

        // Возвращаем true, если фильтрация не применилась или прошла успешно
        return true;
    };

    render() {
        const { searchQuery, filterGender } = this.state;
        const { users, deleteData, selectUser } = this.props;

        const filteredUsers = users.filter(this.filterUsers);

        const searchFilteredUsers = filteredUsers.filter(
            (user) =>
                user.mail.toLowerCase().includes(searchQuery.toLowerCase()) ||
                user.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
                user.surname.toLowerCase().includes(searchQuery.toLowerCase())
        );

        return (
            <div>
                <div className="form-group">
                    <label htmlFor="search">Search</label>
                    <input
                        id="search"
                        type="text"
                        className="form-control"
                        value={searchQuery}
                        onChange={this.handleSearchChange}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="filter">Filter by Gender</label>
                    <select
                        id="filter"
                        className="form-control"
                        value={filterGender}
                        onChange={this.handleFilterChange}
                    >
                        <option value="">All</option>
                        <option value="male">Male</option>
                        <option value="female">Female</option>
                    </select>
                </div>

                <table className="table table-dark">
                    <thead>
                    <tr>
                        <th>Mail</th>
                        <th>Password</th>
                        <th>Name</th>
                        <th>Surname</th>
                        <th>Age</th>
                        <th>Gender</th>
                        <th>Role</th>
                        <th>Reg. Customer</th>
                        <th>About</th>
                    </tr>
                    </thead>
                    <tbody>
                    {searchFilteredUsers.map((user) => (
                        <tr key={user.id}>
                            <td>{user.mail}</td>
                            <td>{user.password}</td>
                            <td>{user.name}</td>
                            <td>{user.surname}</td>
                            <td>{user.age}</td>
                            <td>{user.gender.gender}</td>
                            <td>{user.rolesList[0].role}</td>
                            <td>{user.regularCustomer.id}</td>
                            <td>{user.about}</td>

                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default SearchAndFilter;
